import {  AUTH_USER_FAILURE } from '../actionTypes/actionTypes';

const initialState = {
  serverMessage: null
};

export default function(state = initialState, action) {
  switch (action.type) {
    case AUTH_USER_FAILURE:
      return {
        serverMessage: action.payload
      };

    default:
      return state;
  }
}
